import React from 'react'
import { BrowserRouter, Route, Routes } from 'react-router-dom'
import Login from './app/login'

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Login />} />
      </Routes>
    </BrowserRouter>
  )
}

export default App
